templates.template_content:
{{- $layer3Interfaces := .ModelStore.Multi "layer3_interfaces" "preloads=node" -}}
{{- $subnets := .ModelStore.Multi "subnets" "sort=+name" -}}
{{- $networkUtil := .Network -}}
{{- $collectionUtil := .Collection -}}

{{- $subnetMap := $collectionUtil.Hash $subnets.Records "ID" -}}
{{- $subnetNodeInterfacesMap := $collectionUtil.Map -}}

nwdiag {
{{- range $i, $subnet := $subnets.Records }}
  network {{ $subnet.Name }} {
    address = "{{ $subnet.Address }}/{{ $subnet.Prefix }}"
  {{- $subnetCIDRString := printf "%s/%d" $subnet.Address $subnet.Prefix }}
  {{- $subnetCIDR := $networkUtil.ParseCIDR $subnetCIDRString }}

  {{- range $j, $layer3Interface := $layer3Interfaces.Records }}
    {{- if eq $subnet.VlanID $layer3Interface.VlanID }}
      {{- $layer3InterfaceCIDRString := printf "%s/%d" $layer3Interface.Ipv4Address $layer3Interface.Ipv4Prefix }}
      {{- $layer3InterfaceCIDR := $networkUtil.ParseCIDR $layer3InterfaceCIDRString }}

      {{- $isIncluding := $subnetCIDR.IsIncluding $layer3InterfaceCIDR }}
      {{- if eq $isIncluding true }}
    {{ $layer3Interface.Node.Name }} [address = "{{ $layer3Interface.Name }} ({{ $layer3Interface.Ipv4Address }})"]
      {{- end }}
    {{- end }}
  {{- end }}
  }
{{- end }}
}

{{- $nodes := .ModelStore.Multi "nodes" "preloads=ports" -}}
{{- $ports := .ModelStore.Multi "ports" "" -}}
{{- $nodeMap := .Collection.Hash $nodes.Records "ID" -}}
{{- $links := .ModelStore.Multi "links" "" -}}
---------- nodes.csv ----------
ID,Name
{{- range $i, $node := $nodes.Records }}
{{ $node.ID }},{{ $node.Name }}
{{- end }}
---------- ports.csv ----------
ID,Name
{{- range $i, $port := $ports.Records }}
{{ $port.ID }},{{ $port.Name }}
{{- end }}
---------- nodeports.csv ----------
NodeID,PortID
{{- range $i, $node := $nodes.Records }}
  {{- range $j, $port := $node.Ports }}
{{ $node.ID }},{{ $port.ID }}
  {{- end }}
{{- end }}
---------- links.csv ----------
SourcePortID,DestinationPortID
{{- range $i, $link := $links.Records }}
{{ $link.SourcePortID }},{{ $link.DestinationPortID }}
{{- end }}
--------------------

LOAD CSV WITH HEADERS FROM "file:///nodes.csv" AS csvLine
CREATE (n: Node {id: toInt(csvLine.ID), name: csvLine.Name} )

LOAD CSV WITH HEADERS FROM "file:///ports.csv" AS csvLine
CREATE (p: Port {id: toInt(csvLine.ID), name: csvLine.Name} )

LOAD CSV WITH HEADERS FROM "file:///nodeports.csv" AS csvLine
MATCH (p: Port {id: toInt(csvLine.PortID)}), (n: Node {id: toInt(csvLine.NodeID)})
CREATE (n)-[:has]->(p)

LOAD CSV WITH HEADERS FROM "file:///links.csv" AS csvLine
MATCH (sp: Port {id: toInt(csvLine.SourcePortID)}), (dp: Port {id: toInt(csvLine.DestinationPortID)})
CREATE (sp)-[:connected]->(dp)

{{- $modelStore := .ModelStore -}}
{{- $collectionUtil := .Collection -}}
{{- $nodes := $modelStore.Multi "nodes" "preloads=ports" -}}
{{- $nodeMap := $collectionUtil.Hash $nodes.Records "ID" -}}
{{- $links := $modelStore.Multi "links" "" -}}
{{- $ports := $modelStore.Multi "ports" "preloads=link,vlan_port_associations.vlan" -}}
{{- $portMap := $collectionUtil.Hash $ports.Records "ID" -}}
{{- $subnets := $modelStore.Multi "subnets" "preloads=layer3_interfaces" -}}
{{- $subnetMap := $collectionUtil.Hash $subnets.Records "ID" -}}
{{- $layer2Links := $modelStore.Multi "layer2_links" "" -}}
{{- $layer2Nodes := $modelStore.Multi "layer2_nodes" "preloads=ports.vlan" -}}
{{- $layer2Ports := $modelStore.Multi "layer2_ports" "preloads=layer3_interfaces" -}}
{{- $layer2PortMap := $collectionUtil.Hash $layer2Ports.Records "PortID" -}}
{{- $layer3Nodes := $modelStore.Multi "layer3_nodes" "preloads=layer3_interfaces" -}}
{{- $layer3NodeMap := $collectionUtil.Hash $layer3Nodes.Records "NodeID" -}}
{{- $layer3InterfaceSupportingNodes := $modelStore.Multi "layer3_interface_supporting_nodes" "" -}}
{{- $layer3InterfaceSupportingNodeMap := $collectionUtil.Hash $layer3InterfaceSupportingNodes.Records "ID" -}}
{
  "ietf-network:networks": {
    "network": [
      {{/* Layer1 */ -}}
      {
        "network-types": {},
        "network-id": "target-L1",
        "node": [
{{- $iFirst := $collectionUtil.Map "first" true }}
{{- range $i, $node := $nodes.Records }}
          {{- $first := $iFirst.Get "first" }}{{ if eq $first false }},{{ end }}
          {
            "node-id": "{{ $node.Name }}",
            "ietf-network-topology:termination-point": [
  {{- $jFirst := $collectionUtil.Map "first" true }}
  {{- range $j, $port := $node.Ports }}
    {{- $port := $portMap.Get $port.ID }}
    {{- if not $port.Link }}
    {{- else }}
      {{- $first := $jFirst.Get "first" }}{{ if eq $first false }},{{ end }}
              {
                "tp-id": "{{ $port.Name }}"
              }{{ $iFirst := $jFirst.Put "first" false }}
    {{- end }}
  {{- end }}
            ]
          }{{ $iFirst := $iFirst.Put "first" false }}
{{- end }}
        ],
        "ietf-network-topology:link": [
{{- $iFirst := $iFirst.Put "first" true }}
{{- range $i, $link := $links.Records }}
  {{- $first := $iFirst.Get "first" }}{{ if eq $first false }},{{ end }}
          {
    {{- $sourcePort := $portMap.Get $link.SourcePortID }}
    {{- $destinationPort := $portMap.Get $link.DestinationPortID }}
    {{- $sourceNode := $nodeMap.Get $sourcePort.NodeID }}
    {{- $destinationNode := $nodeMap.Get $destinationPort.NodeID }}
            "link-id": "{{ $sourceNode.Name }},{{ $sourcePort.Name }},{{ $destinationNode.Name }},{{ $destinationPort.Name }}",
            "source": {
              "source-node": "{{ $sourceNode.Name }}",
              "source-tp": "{{ $sourcePort.Name }}"
            },
            "destination": {
              "dest-node": "{{ $destinationNode.Name }}",
              "dest-tp": "{{ $destinationPort.Name }}"
            }
          }{{ $iFirst := $iFirst.Put "first" false }}
{{- end }}
        ]
      },
      {{/* Layer2 */ -}}
      {
        "network-types": {
          "ietf-l2-topology:l2-network": {}
        },
        "network-id": "target-L2",
        "ietf-l2-topology:l2-network-attributes": {
          "name": "L2 of target network",
          "flag": []
        },
        "supporting-network": [
          {
            "network-ref": "target-L1"
          }
        ],
        "node": [
{{- $iFirst := $collectionUtil.Map "first" true }}
{{- range $i, $layer2Node := $layer2Nodes.Records }}
  {{- $first := $iFirst.Get "first" }}{{ if eq $first false }},{{ end }}
          {
            "node-id": "{{ $layer2Node.BridgeName }}",
            "ietf-network-topology:termination-point": [
  {{- $jFirst := $collectionUtil.Map "first" true }}
  {{- range $j, $layer2Port := $layer2Node.Ports }}
    {{- $port := $portMap.Get $layer2Port.PortID }}
    {{- $first := $jFirst.Get "first" }}{{ if eq $first false }},{{ end }}
              {
                "tp-id": "{{ $layer2Port.PortName }}"
    {{- if  $layer2Port.Layer3Interfaces }},
                "ietf-l2-topology:l2-termination-point-attributes": {
                  "description": "",
                  "maximum-frame-size": 1500,
                  "mac-address": "{{ $port.MacAddress }}",
                  "eth-encapsulation": "",
                  "port-vlan-id": {{ $layer2Port.VlanID }},
                  "vlan-id-name": [
      {{- $jFirst := $collectionUtil.Map "first" true }}
      {{- range $j, $layer3Interface := $layer2Port.Layer3Interfaces }}
        {{- $subnet := $subnetMap.Get $layer3Interface.SubnetID }}
        {{- $first := $jFirst.Get "first" }}{{ if eq $first false }},{{ end }}
                    {
                      "vlan-id": {{ $layer2Port.VlanID }},
                      "vlan-name": "{{ $subnet.Name }}"
                    }{{ $jFirst := $jFirst.Put "first" false }}
        {{- end }}
                  ],
                  "tp-state": "in-use"
                }
      {{- end }}
      {{- if ne $layer2Port.PortID 0 }}
        {{- if $port.Link }},
          {{- $node := $nodeMap.Get $port.NodeID }}
                "supporting-termination-point": [
                  {
                    "network-ref": "target-L1",
                    "node-ref": "{{ $node.Name }}",
                    "tp-ref": "{{ $port.Name }}"
                  }
                ]
        {{- end }}
      {{- end }}
              }{{ $jFirst := $jFirst.Put "first" false }}
  {{- end }}
            ],
            "ietf-l2-topology:l2-node-attributes": {
              "name": "{{ $layer2Node.BridgeName }}",
              "description": "L2 of {{ $layer2Node.NodeName }}",
              "management-address": [],
              "sys-mac-address": "",
              "management-vid": 0,
              "flag": []
            },
            "supporting-node": [
              {
                "network-ref": "target-L1",
                "node-ref": "{{ $layer2Node.NodeName }}"
              }
            ]
          }{{ $iFirst := $iFirst.Put "first" false }}
{{- end }}
        ],
        "ietf-network-topology:link": [
{{- $iFirst := $iFirst.Put "first" true }}
{{- range $i, $layer2Link := $layer2Links.Records }}
  {{- $first := $iFirst.Get "first" }}{{ if eq $first false }},{{ end }}
          {
            "link-id": "{{ $layer2Link.SourceBridgeName }},{{ $layer2Link.SourcePortName }},{{ $layer2Link.DestinationBridgeName }},{{ $layer2Link.DestinationPortName }}",
            "source": {
              "source-node": "{{ $layer2Link.SourceBridgeName }}",
              "source-tp": "{{ $layer2Link.SourcePortName  }}"
            },
            "destination": {
              "dest-node": "{{ $layer2Link.DestinationBridgeName }}",
              "dest-tp": "{{ $layer2Link.DestinationPortName }}"
            }
          }{{ $iFirst := $iFirst.Put "first" false }}
{{- end }}
        ]
      },
      {
        "network-id": "target-L3",
        "network-types": {
          "ietf-l3-unicast-topology:l3-unicast-topology": {}
        },
        "supporting-network": [
          {
            "network-ref": "target-L2"
          },
          {
            "network-ref": "target-L1"
          }
        ],
        "node": [
{{- $iFirst := $iFirst.Put "first" true }}
{{- range $i, $layer3Node := $layer3Nodes.Records }}
  {{- $first := $iFirst.Get "first" }}{{ if eq $first false }},{{ end }}
          {
            "node-id": "{{ $layer3Node.NodeName }}",
            "ietf-network-topology:termination-point": [
  {{- $jFirst := $collectionUtil.Map "first" true }}
  {{- range $j, $layer3Interface := $layer3Node.Layer3Interfaces }}
    {{- $first := $jFirst.Get "first" }}{{ if eq $first false }},{{ end }}
              {
                "tp-id": "{{ $layer3Interface.Name }}",
                "ietf-l3-unicast-topology:l3-termination-point-attributes": {
                  "ip-address": ["{{ $layer3Interface.Ipv4Address }}"]
                },
                "supporting-termination-point": [
                  {
                    "network-ref": "target-L2",
                    "node-ref": "{{ $layer3Node.NodeName }}",
                    "tp-ref": "{{ $layer3Interface.Name }}"
                  }
                ]
              }{{ $jFirst := $jFirst.Put "first" false }}
    {{- end }}
            ],
            "ietf-l3-unicast-topology:l3-node-attributes": {
              "prefix": [
  {{- $jFirst := $jFirst.Put "first" true }}
  {{- range $j, $layer3Interface := $layer3Node.Layer3Interfaces }}
    {{- $first := $jFirst.Get "first" }}{{ if eq $first false }},{{ end }}
    {{- $subnet := $subnetMap.Get $layer3Interface.SubnetID }}
                {
                  "prefix": "{{ $subnet.Address }}/{{ $subnet.Prefix }}",
                  "metric": 100,
                  "flag": []
                }{{ $jFirst := $jFirst.Put "first" false }}
  {{- end }}
              ]
            },
            "supporting-node": [
              {
                "network-ref": "target-L2",
                "node-ref": "{{ $layer3Node.NodeName }}"
              }
            ]
          }{{ $iFirst := $iFirst.Put "first" false }}
{{- end }}
{{- range $i, $subnet := $subnets.Records }}
  {{- $first := $iFirst.Get "first" }}{{ if eq $first false }},{{ end }}
          {
            "node-id": "Seg-{{ $subnet.Name }}",
            "ietf-network-topology:termination-point": [
  {{- $jFirst := $collectionUtil.Map "first" true }}
  {{- range $j, $layer3Interface := $subnet.Layer3Interfaces }}
    {{- $node := $nodeMap.Get $layer3Interface.NodeID }}
    {{- $first := $jFirst.Get "first" }}{{ if eq $first false }},{{ end }}
              {
                "tp-id": "p{{ $layer3Interface.ID }}",
                "supporting-termination-point": [
                  {
                    "network-ref": "target-L2",
                    "node-ref": "{{ $node.Name }}",
                    "tp-ref": "{{ $layer3Interface.Name }}"
                  }
                ]
              }{{ $jFirst := $jFirst.Put "first" false }}
  {{- end }}
            ],
            "ietf-l3-unicast-topology:l3-node-attributes": {
              "prefix": [
                {
                  "prefix": "{{ $subnet.Address }}/{{ $subnet.Prefix }}",
                  "metric": 100,
                  "flag": ["l3-segment", "pseudo-node"]
                }{{ $jFirst := $jFirst.Put "first" false }}
              ]
            },
            "supporting-node": [
  {{- $jFirst := $collectionUtil.Map "first" true }}
  {{- range $j, $layer3Interface := $subnet.Layer3Interfaces }}
    {{- $layer3InterfaceSupportingNode := $layer3InterfaceSupportingNodeMap.Get $layer3Interface.ID }}
    {{- $first := $jFirst.Get "first" }}{{ if eq $first false }},{{ end }}
              {
                "network-ref": "target-L2",
                "node-ref": "{{ $layer3InterfaceSupportingNode.BridgeName }}"
              }{{ $jFirst := $jFirst.Put "first" false }}
  {{- end }}
            ]
          }{{ $iFirst := $iFirst.Put "first" false }}
{{- end }}
        ],
        "ietf-network-topology:link": [
{{- $iFirst := $collectionUtil.Map "first" true }}
{{- range $i, $subnet := $subnets.Records }}
  {{- range $j, $layer3Interface := $subnet.Layer3Interfaces }}
    {{- $node := $layer3NodeMap.Get $layer3Interface.NodeID }}
    {{- $first := $iFirst.Get "first" }}{{ if eq $first false }},{{ end }}
          {
            "link-id": "Seg-{{ $subnet.Name }},p{{ $layer3Interface.ID}},{{ $node.NodeName }},{{ $layer3Interface.Name }}",
            "source": {
              "source-node": "Seg-{{ $subnet.Name }}",
              "source-tp": "p{{ $layer3Interface.ID}}"
            },
            "destination": {
              "dest-node": "{{ $node.NodeName }}",
              "dest-tp": "{{ $layer3Interface.Name }}"
            }
          },
          {
            "link-id": "{{ $node.NodeName }},{{ $layer3Interface.Name }},Seg-{{ $subnet.Name }},p{{ $layer3Interface.ID}}",
            "source": {
              "source-node": "{{ $node.NodeName }}",
              "source-tp": "{{ $layer3Interface.Name }}"
            },
            "destination": {
              "dest-node": "Seg-{{ $subnet.Name }}",
              "dest-tp": "p{{ $layer3Interface.ID}}"
            }
          }{{ $iFirst := $iFirst.Put "first" false }}
  {{- end }}
{{- end }}
        ]
      }
    ]
  }
}
